import React, { Component } from "react";

import "./Tutorial.css";

export default class Tutorial extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3>Welcome to the Pathfinding Simulator</h3>
        <h6>
          This short tutorial will walk you through all of the features of this
          application.
        </h6>
        <p className="paragraph">
          If you want to dive right in, feel free to press the "Skip Tutorial"
          button below. Otherwise, press "Next"!
        </p>
        <div className="page">1/9</div>
        <button
          className="next"
          //   class="btn btn-default navbar-btn"
          //   type="button"
        >
          Next
        </button>
        <button
          className="previous"
          //   class="btn btn-default navbar-btn"
          //   type="button"
        >
          Previous
        </button>
        <button
          className="skip"
          //   class="btn btn-default navbar-btn"
          //   type="button"
        >
          Skip Tutorial
        </button>
      </div>
    );
  }
}
